catalog_script_client.script:
function onLoad() {
   //Type appropriate comment here, and begin script below
   if(g_form.getValue("attendee_count") == "" && g_form.isNewRecord() == false){
		g_form.setVisible("attendee_count", false);
   } else{
		g_form.setVisible("attendee_count", true);
   }
	g_form.addInfoMessage(g_form.getValue("attendee_count"));
}
